/* ---- ROM data stub initialization ---- */
#include <stdio.h>
#include <string.h>
extern u8* gRomData;
extern u32 gRomSize;

#define PORT_DATA_STUB_SIZE 1024

void Port_InitDataStubs(void) {
    if (!gRomData || gRomSize == 0) {
        fprintf(stderr, "Port_InitDataStubs: ROM not loaded yet!\n");
        return;
    }
    u32 count = 0;
    /* gUnk_080046A4 and gUnk_080047F6 — now provided by src/data/data_080046A4.c */
    /* Hitbox data (gUnk_080FD178 through gUnk_080FD588) now provided by src/data/hitbox.c - no ROM loading needed */
    /* gUnk_0810B6EC @ 0x0810B6EC â€” SpriteLoadData* pointer table, resolve GBA addrs */
    {
        u32 off = 0x10B6ECu;
        for (u32 i = 0; i < 21; i++) {
            u32 gba_addr;
            memcpy(&gba_addr, &gRomData[off + i * 4], 4);
            if (gba_addr >= 0x08000000u && gba_addr < 0x08000000u + gRomSize)
                gUnk_0810B6EC[i] = &gRomData[gba_addr - 0x08000000u];
            else
                gUnk_0810B6EC[i] = NULL;
        }
        count++;
    }
    /* gUnk_0810B774 and gUnk_0810B77C: function pointer tables, defined natively in port_linked_stubs.c â€” skip ROM
     * loading */
    /* gUnk_08128A38 and gUnk_08128AD8: defined in figurineMenuData.c â€” skip ROM loading */
    /* gUnk_08128D14, D24, D30: func ptr tables â€” defined in port_linked_stubs.c, skip ROM loading */
    /* gUnk_08128D58: func ptr table â€” defined in port_linked_stubs.c, skip ROM loading */
    /* gUnk_08128DB0: func ptr table â€” defined in port_linked_stubs.c, skip ROM loading */
    /* gUnk_08128DCC: func ptr table â€” defined in port_linked_stubs.c, skip ROM loading */
    /* gUnk_08128E78: func ptr table â€” defined in port_linked_stubs.c, skip ROM loading */
    /* gUnk_08128F1C: func ptr table â€” defined in port_linked_stubs.c, skip ROM loading */
    /* gUnk_08134FBC..gUnk_0813ADEC (transitions + screen transitions) now provided by src/data/ */
    /* gCollisionMtx — populate the full buffer from ROM.
     * collision.c declares it as `extern ColSettings gCollisionMtx[173*34]`
     * (each ColSettings = 12 bytes).  On GBA, reads go well beyond the 1210
     * bytes at 0x080B7B74 into adjacent ROM data.  Copy the full region so
     * collision handlers with hardcoded indices (like 0x11AA) also work. */
    {
        extern u8 gCollisionMtx[];
        u32 col_rom_off = 0x000B7B74u;
        u32 col_size = 173u * 34u * 12u; /* 70584 bytes */
        if (col_rom_off + col_size <= gRomSize) {
            memcpy(gCollisionMtx, &gRomData[col_rom_off], col_size);
        } else if (gRomSize > col_rom_off) {
            /* Partial copy: fill what we have, zero the rest */
            u32 avail = gRomSize - col_rom_off;
            memcpy(gCollisionMtx, &gRomData[col_rom_off], avail);
            memset(&gCollisionMtx[avail], 0, col_size - avail);
        }
        count++;
    }
    fprintf(stderr, "Port_InitDataStubs: initialized %u data stubs from ROM.\n", count);
}
